import { Text, View } from 'react-native'
import React from 'react'
import tw from 'tailwind-react-native-classnames'

const Schedule = () => {
  return (
    <View style={tw`p-8`}>
    <View style={tw`w-full h-40 absolute bg-red-700 bottom-10 rounded-lg`}>
      <Text>Schedule</Text>
    </View>
    </View>
  )
}

export default Schedule
